import React from "react";
import SearchForm from "./searchForm";
import ItemCardPage from "../page/itemCardPage";

const MainComponent = () => {
    return (
    <>
    <h1>Прогноз погоды</h1>
    <SearchForm />
    <ItemCardPage />
    </>
    );
};

export default MainComponent;
